function [dV,dTheta,dHeading] = Trajectory(P, Angles, AeroForces, TrajState,g, m)

A = Angles.A;
B = Angles.B;
Roll = Angles.Roll;

Theta = TrajState.Theta;
V = TrajState.V;

mg = m*g;

dV = P*cos(A)*cos(B) - AeroForces.X - mg*sin(Theta);

dTheta = P*(cos(B)*sin(A)*cos(Roll) - sin(B)*cos(A)*sin(Roll)) + ...
        (AeroForces.Y + AeroForces.Y2)*cos(Roll) - ...
         mg*cos(Theta) - (AeroForces.Z + AeroForces.Z2)*sin(Roll);

dHeading = P*(cos(B)*sin(A)*sin(Roll) + sin(B)*cos(A)*cos(Roll)) + ...
        (AeroForces.Y + AeroForces.Y2)*sin(Roll) + ...
        (AeroForces.Z + AeroForces.Z2)*cos(Roll);


dV = dV/m;
dTheta = dTheta/(m*V);
dHeading = dHeading/(m*V*cos(Theta));

function [dwz,dwx,dwy] = Rotation(AeroForces,dM,W, Sholders, J)

dwz = -Sholders.x0*AeroForces.Y - Sholders.x1*AeroForces.Y2 - dM.Mwz*W.wz;
dwx = AeroForces.Mx - dM.Mwx*W.wx + Sholders.y0*AeroForces.Z2 + dM.Mwyx*W.wy;
dwy = -Sholders.x0*AeroForces.Z - Sholders.x1*AeroForces.Z2 - dM.Mwy*W.wy;

dwz = dwz/J.z;
dwx = dwx/J.x;
dwy = dwy/J.y;

function [A,B,R] = fcn(v,x,y,z)

v = transpose(v);

Vx = dot(v,x);
Vy = dot(v,y);
Vz = dot(v,z);

B = -rad2deg(atan(Vz/Vx));
A = -rad2deg(atan(Vy/Vx));

%x1*z - x*x3

sinus = (-x(3)*y(1)+x(1)*y(3))/norm([-x(3), x(1)]);
R2 = asin(sinus);
R2 = rad2deg(R2);
% R = rad2deg(atan(y(3)/sqrt(y(1)^2 + y(2)^2)));
R = R2;
end

function v = fcn(TrajData)

c = TrajData.Heading;
o = TrajData.Theta;

x = cos(c)*cos(o);
y = sin(o);
z = sin(c)*cos(o);

v = [x, y, z];

function [dNorth, dEast, dHeight] = Movement(TrajData)


  dHeight = TrajData.V*sin(TrajData.Theta);

  Vhorizontal = TrajData.V*cos(TrajData.Theta);

  dEast = Vhorizontal*sin(TrajData.Heading);
  dNorth = Vhorizontal*cos(TrajData.Heading);

end
